import React from 'react';
import './Main.css';

const Main = ({ fixtures }) => {
    return (
        <div className="fixture-container">
            {fixtures.length > 0 ? (
                fixtures.map((fixture) => (
                    <div className="fixture-card" key={fixture.matchId}>
                        <h3>{fixture.team1} vs {fixture.team2}</h3>
                        <p>Date: {fixture.matchDate}</p>
                        <p>Type: {fixture.matchType}</p>
                        <p className="score">{fixture.team1} Score: {fixture.team1Score}</p>
                        <p className="score">{fixture.team2} Score: {fixture.team2Score}</p>
                    </div>
                ))
            ) : (
                <p>No fixtures available</p>
            )}
        </div>
    );
};

export default Main;
